	["cu_galil_abrasion"] = { name = "Chatterbox", desc = "Den har handmålats och getts ett slitet utseende. Dödskallen som är målad över dammskyddet ser ut att hacka tänder när slutstycket repeterar.\n\nVissa säger att när du skrattar, så skrattar hela världen med dig... men när Chatterbox skrattar, finns bara skrik" },
	["cu_glock_deathtoll"] = { name = "Catacombs", desc = "Den har målats hydrografiskt med ett dödskallemönster över en silvermetallic grund.\n\nHot är den ärligaste formen av smicker" },
	["cu_m4a4_ancestral"] = { name = "龍王 (Dragon King)", desc = "Den har egenmålats med bilden av en drake i rött och blått.\n\nEtt vapen värdigt för Apkungen - Booth, vapenhandlare" },
	["cu_m249_sektor"] = { name = "System Lock", desc = "Den har egenmålats med en sci-fi-design.\n\nTäckeld har aldrig sett så bra ut" },
	["am_mac10_malachite"] = { name = "Malachite", desc = "Den har målats med effektfärger i metallic och getts ett vågigt mönster med hjälp av ett kamverktyg av gummi.\n\nStarka färger gömmer ett vapen med mörk avsikt" },
	["cu_mp9_deadly_poison"] = { name = "Deadly Poison", desc = "Den har egenmålats med dynamiska, kantiga former och en stylad spindel.\n\nDet är inte det första bettet som dödar dig, det är de 29 som kommer efter" },
	["cu_p250_mandala"] = { name = "Muertos", desc = "Den har egenmålats med cirkulära motiv.\n\nDen här är genomdränkt av tradition och blod" },
	["cu_sawedoff_deva"] = { name = "Serenity", desc = "Den har handmålats med bilden av en kvinna med vingar.\n\nSinnesro är en lyx som få har råd med - Valeria Jenner, revolutionär" },
	["aq_scar20_leak"] = { name = "Grotto", desc = "Den har svampats och penselmålats med blå effektfärger i metallic.\n\nGrundaren av Season Corporation beställde detta verk efter att ha blivit räddad av den berömda operatören Kotaro Izaki" },
	["aq_xm1014_sigla"] = { name = "Quicksilver", desc = "Den har målats med hjälp av genomskinlig hydrografik med ett terrängtema av metallsilverfärg.\n\nIbland behöver du ett instabilt element för att lösa dina problem - Kotaro Izaki, bräschexpert" },
	["an_tiger_orange"] = { name = "Tiger Tooth", desc = "Den har anodiserats orange och handgraverats med ett mönster av tigerränder.\n\nLikt tigern är den sällsynt... likt tigern är den dödlig..." },
	["am_marble_fade"] = { name = "Marble Fade", desc = "Den har målats med svart- och silvermetallic med hjälp av ett marmoreringsmedium, därefter har den kanderats i tre färger.\n\nBladet består av många färger, men snart ser allt rött ut" },
	["am_marbleized"] = { name = "Doppler", desc = "Den har målats med svart- och silvermetallicfärger med hjälp av marmorering för att sedan bli kanderad.\n\nAtt tappa bort sig i dess färger kan visa sig vara dödligt" },
	["cu_ak47_mastery"] = { name = "Elite Build", desc = "It has been custom painted using a combination of hydrographics and careful stenciling and detailed with heat-transfer decals.\n\nTread softly Naomi...people in your line of work aren't known for their longevity - The Shield and The Serpent Part 2" },
	["aq_mp7_ultramodern"] = { name = "Armor Core", desc = "Den har målats med svart oljebaserad färg och har getts borstade rostfria ståldelar och inlägg.\n\nPerfekt för operatören som värdesätter raffinemang såväl som eldkraft - Booth, vapenhandlare" },
	["aq_awp_twine"] = { name = "Worm God", desc = "Den har målats med en skalle och rötter med hjälp av hållfasta emaljfärger.\n\nVissa rötter vill man inte veta av." },
	["am_bronze_sparkle"] = { name = "Bronze Deco", desc = "Den har målats i ett art deco-mönster med hjälp av metallic billack.\n\nAlla letar efter silver och guld" },
	["aq_p250_contour"] = { name = "Valence", desc = "Den har egenmålats i en modern blå och grå design som komplementerar vapnets form.\n\nDin kompetens ifrågasätts inte, din attityd däremot - Läraren och ikonoklasten, del 1" },
	["cu_fiveseven_banana"] = { name = "Monkey Business", desc = "Det är en banan.\n\nIbland är det okej att leka med maten" },
	["cu_galil_eco"] = { name = "Eco", desc = "Den har målats vit och grön och är detaljerad med värmeledande dekaler.\n\nFör tillräckligt med pengar kommer Elite Crew ta orsaken som sin egen" },
	["aq_famas_jinn"] = { name = "Djinn", desc = "Den har fått inlägg av guld och nickel och är graverad med en bild av en djinn.\n\nVar försiktig med vad du önskar" },
	["cu_m4a1_hyper_beast"] = { name = "Hyper Beast", desc = "It has been custom painted with a beastly creature in psychadelic colours.\n\nYou really want to impress me Booth? Make this black light sensitive - Rona Sabri, Rising Star" },
	["cu_mag7_redhot"] = { name = "PaintKit_cu_mac10_redhot_tag", desc = "PaintKit_cu_mac10_redhot" },
	["am_negev_glory"] = { name = "PaintKit_am_awp_glory_Tag", desc = "PaintKit_am_awp_glory" },
	["cu_mac10_neonrider"] = { name = "Neon Rider", desc = "Den har egenmålats med en bild av en dödlig motorcyklist.\n\nEn del handelvapen, två delar plastmapp" },
	["cu_sawedoff_origami"] = { name = "Origami", desc = "Den har custom-målats med en origami-inspirerad design.\n\nDet tar tid att bygga något vackert, men endast ett ögonblick att förstöra det" },
	["cu_cz75_precision"] = { name = "Pole Position", desc = "Den har custom-målats med rött och grått racing-tema.\n\nVi får bara ett försök på detta, så låt oss göra det rätt - Felix Riley, Commanding Officer" },
	["am_ump_racer"] = { name = "Grand Prix", desc = "Den har custom-målats med ett gammaldags racing-motiv.\n\nGlöm inte hjälmen" },
	["am_aqua_flecks"] = { name = "Twilight Galaxy", desc = "am_aqua_flecks" },
	["cu_chronos_g3sg1"] = { name = "Chronos", desc = "Det har dekorerats hydrografiskt med bilder föreställande kugghjul och andra klockmekanismer i psykedeliska färger, och betonats med värmeöverföringsdekaler. \n\nTids nog är allting möjligt" },
	["hy_hades"] = { name = "Hades", desc = "Den har målats med hydrografik av antika grekiska hjälmar.\n\nOm hon ville att jag skulle hålla en intervju, så hade det funnits enklare sätt att boka den - Skölden och sagoberättaren, del 2" },
	["hy_icarus"] = { name = "Icarus Fell", desc = "Det har målats hydrografiskt med en bild på fjädrar och smält vax runt ett solmotiv.\n\nTurners förräderi är mitt misslyckande... jag måste ställa detta till rätta - Sebastien Hennequet, prickskytt" },
	["cu_labyrinth"] = { name = "Minotaur's Labyrinth", desc = "Den har målats hydrografiskt med en bild föreställande en isometrisk labyrint.\n\nDu kan inte fly från mig" },
	["sp_labyrinth1"] = { name = "Asterion", desc = "Den har spraymålats med en stencil av en isometrisk labyrint.\n\nKungar är bara män... och ingen man ska tillbes - Valeria Jenner, revolutionär" },
	["sp_labyrinth2"] = { name = "Pathfinder", desc = "Den har spraymålats med en stencil av en isometrisk labyrint.\n\nPersonligen föredrar jag den 4:e utgåvan, men kunden har alltid rätt - Booth, vapenhandlare" },
	["sp_labyrinth3"] = { name = "Daedalus", desc = "Den har spraymålats med en bild föreställande en isometrisk labyrint.\n\nImogen... om de någonsin upptäcker vad du har gjort kommer det att kosta oss allt - \"A Family Affair\" del 1" },
	["cu_medusa_awp"] = { name = "Medusa", desc = "Det har egenmålats med en bild föreställande en gorgon.\n\nOm du kan se mig är du redan död" },
