	["aa_pandora"] = { name = "Pandora's Box", desc = "Den har airbrushats med tecknade andar.\n\n Världen brinner men vi har åtminstone hoppet kvar" },
	["cu_poseidon"] = { name = "Poseidon", desc = "Den har egenmålats med en bild föreställande striden mellan fiskarna och Poseidon.\n\nTre kan bevara en hemlighet om två av dem är döda" },
	["hy_zodiac1"] = { name = "Moon in Libra", desc = "Den har målats hydrografiskt med ett zodiakmotiv.\n\nIdag är en utmärkt dag för att hitta romantiken och döda ens rivaler" },
	["hy_zodiac2"] = { name = "Sun in Leo", desc = "Den har målats hydrografiskt med ett zodiakmotiv.\n\nDet kommer att bli en tuff månad för dina fiender" },
	["hy_zodiac3"] = { name = "Shipping Forecast", desc = "Den har målats hydrografiskt med ett zodiakmotiv.\n\nVem vet vad framtiden för med sig" },
	["so_khaki_green"] = { name = "Para Green", desc = "Den har individuella delar sprejmålade i ett khakigrönt och grått färgtema.\n\nVem han en gång var förändrar inte vem han har blivit. Oroa dig inte, Felix... jag ska stoppa honom - \"The Paladin and The Teacher\" del 2" },
	["cu_anime_aug"] = { name = "Akihabara Accept", desc = "Den har dekorerats med värmeöverförd vinyl av omslaget från en animetidning.\n\nYatta!" },
	["am_bamboo_jungle"] = { name = "Hydroponic", desc = "Den har målats med ett bambumotiv med metallicfärger.\n\nNotera hur gevärssmeden Yukako använde AK-47:ans trä för att framhäva hennes grönskande tema... gör inget misstag: hydroponik är lika vackert och dödligt som naturen själv - Imogen, vapenhandlare i träning" },
	["hy_bamboo_jungle_ink"] = { name = "Bamboo Print", desc = "Den har målats med hydrografik av penselmålad bambu.\n\nSätt in vits om bambuskott här" },
	["hy_bamboo_jungle_black"] = { name = "Bamboo Shadow", desc = "Den har målats med hydrografik av penselmålad bambu.\n\nKotaro förlorade sin son till det här vapnet... och en dag ska han använda det för att stoppa den som gjorde det" },
	["hy_bamboo_jungle"] = { name = "Bamboo Forest", desc = "Den har målats med hydrografik av penselmålad bambu.\n\nJag tycker fortfarande att den borde ha en panda - Booth, vapenhandlare" },
	["am_geometric_steps"] = { name = "Aqua Terrace", desc = "Den har målats med ett geometriskt motiv i metallicfärger.\n\nLugn nu..." },
	["hy_geometric_steps"] = { name = "Geo Steps", desc = "Den har målats hydrografiskt med ett geometriskt motiv." },
	["hy_geometric_steps_green"] = { name = "Counter Terrace", desc = "Den har målats hydrografiskt med ett geometriskt motiv.\n\nDu Sabri, du borde ta denna... den är högljudd som dig - Carmen Cocinero, extraktionsexpert" },
	["hy_geometric_steps_yellow"] = { name = "Terrace", desc = "Den har målats med ett geometriskt motiv med hydrografik.\n\nDu har för mycket förtroende, Valeria... det kommer få dig att dö - Franz Kriegeld, Phoenix-taktiker" },
	["hy_kimono_diamonds"] = { name = "Neon Kimono", desc = "Den har målats hydrografiskt med ett geometriskt motiv.\n\nJag vet att jag begär mycket av dig... Turner var som en son för dig - \"The Paladin and The Teacher\" del 1" },
	["hy_kimono_diamonds_orange"] = { name = "Orange Kimono", desc = "Den har målats hydrografiskt med ett geometriskt motiv.\n\nTradition är ett kraftfullt ting" },
	["hy_kimono_diamonds_red"] = { name = "Crimson Kimono", desc = "Den har målats med hydrografik med ett geometriskt motiv.\n\nTurner, alla män kan brytas... det handlar bara om att hitta rätt tryckpunkt - Förrädaren och sanningssökaren, del 2" },
	["sp_kimono_diamonds"] = { name = "Mint Kimono", desc = "Den har spraymålats hydrografiskt med ett geometriskt motiv.\n\nKom, Booth, låt mig visa dig vad jag arbetat på - Yukako, vapensmed" },
	["am_seastorm"] = { name = "Midnight Storm", desc = "Den har målats hydrografiskt med en bild föreställande ett stormigt hav, ovanpå en grundlack i blå metallic.\n\nJag hatar inte dig, Sebastien... jag tycker synd om dig - Chase Turner, avhoppare från koalitionen" },
	["am_seastorm_blood"] = { name = "Sunset Storm 壱", desc = "Den har målats hydrografiskt med en bild föreställande ett stormigt hav, ovanpå en grundlack i röd metallic.\n\nDu tror att den är likadan men titta igen... subtiliteten gör skillnaden" },
	["am_seastorm_shojo"] = { name = "Sunset Storm 弐", desc = "am_seastorm_shojo" },
	["am_kimono_sunrise"] = { name = "Daybreak", desc = "Den har målats med en soluppgång med metalliska färger.\n\nSolen går upp likadant för de rättfärdiga som för de orättfärdiga" },
	["am_so_keycolors"] = { name = "Impact Drill", desc = "am_so_keycolors" },
	["so_aqua"] = { name = "Seabird", desc = "Den har individuella delar som har spraymålats med ett färgschema av turkos och ljusbrunt.\n\nMin." },
