	["cu_cz75a_chastizer"] = { name = "Yellow Jacket", desc = "Den har egenmålats med böjda former.\n\nSväva som en fjäril, stick som en ettrig och hatfull insekt" },
	["am_famas_dots"] = { name = "Neural Net", desc = "Den har målats med en genomsynlig hydrografik över en metallisk grundfärg.\n\nJag vet. Men det var det enda rätta... - \"A Family Affair\" del 2" },
	["cu_galilar_particles"] = { name = "Rocket Pop", desc = "Den har specialmålats med en grafiskt design i ränder och pixelerade partiklar.\n\nDen perfekta saken för en varm sommardag" },
	["aq_glock18_flames_blue"] = { name = "Bunsen Burner", desc = "Den har getts en blå patina som polerats bort från delar av manteln för att efterlikna en grafisk flamdesign.\n\nKNACK KNACK" },
	["cu_m4a4_evil_daimyo"] = { name = "Evil Daimyo", desc = "Den har specialmålats med en grafisk design i rött och svart.\n\nCarmen. Jag har hittat honom...- \"The Oni and The Valkyrie\" Del 1" },
	["cu_mp7_nemsis"] = { name = "Nemesis", desc = "Den har egenmålats med bilden av ett metalliskt monster.\n\nDen kommer efter dig" },
