	["cu_negev_annihilator"] = { name = "Loudmouth", desc = "Den har egenmålats med en vidunderlig design och sedan givits ett slitet utseende.\n\nKom tillbaka, jag talar med dig!" },
	["cu_nova_ranger"] = { name = "Ranger", desc = "Den har målats med penseldragshydrografik och detaljerats med värmeöverförda dekaler.\n\nVem räknar poängen?" },
	["aq_p2000_boom"] = { name = "Handgun", desc = "Den har egenmålats med en hand som gör en siktesgestikulering.\n\nNu är leken slut" },
	["cu_ump45_uproar"] = { name = "Riot", desc = "Den har målats med en kombination av hydrografik och värmeöverförda dekaler.\n\nOm du inte ville ha kollateralt skadade, kanske du skulle varit lite mer specifik... - Javier Alviso, Fist of the Phoenix" },
	["cu_usp_progressiv"] = { name = "Torque", desc = "Den har specialmålats i en modern svart, vit och gul design.\n\nDe manipulerar dig Kotaro. Och om du inte kan se det, är du i mer trubbel än du vet om... - Felix Riley, befälhavande officer" },
	["cu_ak47_winter_sport"] = { name = "Frontside Misty", desc = "Den har målats i livfulla arktiska färger.\n\nJag gillar att arbeta i snön... det lämnar alltid så fina märken - Javier Alvisa, Fist of the Phoenix" },
