	["gs_glock18_wrathys"] = { name = "Wraiths", desc = "Den har egenmålats med förlorade själar på släden.\n\nFörst genomtränger den slöjan, sen genomtränger den skuggan" },
	["gs_m249_nebula_crusader"] = { name = "Nebula Crusader", desc = "Den har egenmålats till att se ut som en klassisk arkadmaskin.\n\nDu kan använda den, men du måste stoppa in en tia först" },
	["gs_m4a1s_snakebite_gold"] = { name = "Golden Coil", desc = "Den har målats med hydrografik av en angripande orm.\n\nHuggormen kan slå till från var som helst" },
	["cu_mac10_alekhya_duo"] = { name = "Rangeen", desc = "Den har egenmålats med ett antikt egyptiskt motiv.\n\nKan du stå emot dess vredgade blick?" },
	["cu_mag7_myrcene"] = { name = "Cobalt Core", desc = "Den har specialmålats med en futuristisk grafisk design.\n\nHåll honom i säkerhet, Carmen - \"The Valkyrie and The Paramour\" Del 1" },
	["cu_mp7_classified"] = { name = "Special Delivery", desc = "Den har blivit -KLASSIFICERAT-\n\nOm jag gör det du vill, låter du mig gå? - The Phoenix and The Storyteller, del 2" },
	["hy_p250_crackshot"] = { name = "Wingshot", desc = "Den har egenmålats med livfull hydrografik.\n\nIbland behövs bara en liten knuff för att få det du vill - Franz Kriegeld, Phoenix-taktiker" },
	["gs_scar20_peacemaker03"] = { name = "Green Marine", desc = "Den har givits ett kamouflagemönster med metallisk färg.\n\nHör upp folk... Izaki och Cocinero kanske har bondpermis, men vårt uppdrag är ändå det samma: vi ska rädda Alex Kincaide - Felix Riley, befälhavande officer" },
	["cu_ssg08_technicality"] = { name = "Big Iron", desc = "Den har egenmålats med gul och orange hydrografik och sedan givits ett slitet utseende.\n\nEn vinst med en asterisk är fortfarande en vinst - Rona Sabri, uppkommande stjärna" },
	["cu_usp_kill_confirmed"] = { name = "Kill Confirmed", desc = "Den har egenmålats med en bild av en kula som krossar en skalle.\n\n2 i bröstet, 1 i huvudet" },
	["aq_xm1014_scumbria"] = { name = "Scumbria", desc = "Den har målats subtilt med metallisk färg.\n\nGör inget förhastat: det finns kanske ett annat sätt att få Valerias uppmärksamhet... - \"A Father's Love\" Del 3" },
	["cu_ak47_point_disarray"] = { name = "Point Disarray", desc = "Den har egenmålats med en geometrisk hydrografik.\n\nNära är den kaos... från ett avstånd är den vacker - Franz Kriegeld, Phoenix-taktiker" },
	["am_aug_jumble"] = { name = "Ricochet", desc = "Den har egenmålats med ett tvåfärgat stickmönster.\n\nKotaro behöver inte vårt skydd - The Valkyrie and The Paramour, del 2" },
	["cu_bizon_noxious"] = { name = "Fuel Rod", desc = "Den har egenmålats för att ge illusionen av radioaktiv ammunition.\n\nIbland är det fotsoldaterna som har övertag" },
	["aq_deagle_corinthian"] = { name = "Corinthian", desc = "Den har lasergraverats och givits ett anpassat lädergrepp.\n\nBär. Tror. Hoppas. Uthärdar." },
	["cu_fiveseven_retrobution"] = { name = "Retrobution", desc = "Den har egenmålats med retro-hydrografik.\n\nVissa saker går aldrig ur stil" },
	["cu_g3sg1_executioner"] = { name = "The Executioner", desc = "Den har handmålats med en makaber uppvisning av ben.\n\nJag tar alltid en trofé - Javier Alviso, Fist of the Phoenix" },
	["gs_m4a4_royal_squire"] = { name = "Royal Paladin", desc = "Den har etsats och målats noggrant för att ge en känsla av storslagenhet.\n\nDet här telefonsamtalet har aldrig hänt, förstår du? - The Paladin and the Father, del 1" },
	["cu_negev_impact"] = { name = "Power Loader", desc = "Den har egenmålats med hydrografik som påminner om tungt maskineri.\n\nFruktad av drottningar. Älskad av biskopar." },
	["am_p2000_imperial_red"] = { name = "Imperial", desc = "Den har lasergraverats och målats med röd och gul metallicfärg.\n\nMina känslor spelar ingen roll Keo, jag har ett imperium att skydda - Booth, vapenhandlare" },
	["cu_p90_shapewood"] = { name = "Shapewood", desc = "Dess träkolv har täljts för hand, slipats, och laminerats.\n\nPincett inkluderas ej" },
	["gs_sawedoff_necromancer"] = { name = "Yorick", desc = "Den har fått hydrografik av en döskalle och handmålade gulddetaljer.\n\nRosencrantz och Guildenstern hade aldrig en chans..." },
	["hy_scar20_jungler"] = { name = "Outbreak", desc = "Den har målats med livfulla nyanser av grönt.\n\nValeria blir djärvare... det är dags att ta kampen till henne - Felix Riley, kommendant" },
	["gs_sg553_tiger_moth"] = { name = "Tiger Moth", desc = "Den har egenmålats med mönstret av vingarna från en mal.\n\nValeria blir djärvare... det är dags att ta kampen till henne - Felix Riley, kommendant" },
	["cu_tec9_avalanche"] = { name = "Avalanche", desc = "Den har egenmålats med en slick och futuristisk hydrografik.\n\nVi måste tänka på hur vi rör oss mot henne, ett felsteg så kommer hon att rasa ner på oss båda - The Serpent and the Truth Seeker" },
	["aq_xm1014_hot_rod"] = { name = "Teclu Burner", desc = "Metallicfärger har använts för att göra flammor.\n\nIbland är inte en bunsen tillräckligt..." },
	["gs_ak47_supercharged"] = { name = "Fuel Injector", desc = "Gevärets stomme har målats skrikande gul och magasinet har målats speciellt så det liknar maskindelar.\n\nLev ditt liv ett kvarts magasin åt gången" },
	["cu_bizon_citizen"] = { name = "Photic Zone", desc = "Det har specialmålats i ett kamouflagemönster accentuerat med självlysande färg.\n\nDet är inte havets vågor du hör..." },
