	["cu_p250_asiimov"] = { name = "Asiimov", desc = "Den har blivit egenmålad med sci-fi-design.\n\nOm du tror att jag behöver ett gevär för att döda en man, då har du ingen idé om vem du pratar med... - Mikha Biton, Phoenix-krypskytt" },
	["gs_sawedoff_fubar"] = { name = "Fubar", desc = "Detta beresta hagelgevär har markeringar inristade i pipan.\n\nDet börjar med en smäll... och slutar med tystnad" },
	["cu_sg553_atlas"] = { name = "Atlas", desc = "Den har givits hydrografik av modern kamouflage.\n\nDesignen var en gång reserverad för koalitionsstyrkan, men Huxley ägnade sig åt företagsspioneri och fick den att bli exklusiv för Phoenix" },
